				var alien1 = new lib.alien_party;
				stage.addChild(alien1);
				alien1.x = alien1_x;
				alien1.y = alien1_y;
				alien1.gotoAndPlay(i * (2 + i));
				alien1.alien.addChild(new partyobj[i - 1]());
