		//פונקציה שאחראית על הופעה והיעלמות שאלה
		function ticker_func() {
		
			if (check == 0) {
				ansewr_posible = 0;
				if (option == 1) {
					if (spaceship.y >= (stageH / 2) - 70) {
						spaceship.y -= 10;
					} else {
						createjs.Ticker.paused = true;
						ansewr_posible = 1;
					}
				} else {
					createjs.Ticker.paused = true;
				}
			}
			if (option == 2) {
				if (spaceship.y <= stageH + 150) {
					spaceship.y += 10;
				} else {
					nextbtn.alpha = 1;
					spaceship.removeChild(clock);
					createjs.Ticker.paused = true;
					spaceship.removeAllChildren();
					spaceship.base.removeAllChildren();
					spaceship.baseT.removeAllChildren();
					spaceship.baseP.removeAllChildren();
				}
			}
			if (option == 3) {
				alien.x += direction;
				alien.y -= 5;
				alien.scaleX = parseInt(spaceship.y) / 200 * 0.2;
				alien.scaleY = parseInt(spaceship.y) / 200 * 0.2;
				if (alien.y < stageH / 2 + bottom) {
					stage.removeChild(alien);
					checkbtn.alpha = 1;
					currentAns.gotoAndPlay(18);
				}
			}
		
		
			if (option == 4) {
				if (player == 1) {
					spaceship.x -= 15;
				} else {
					spaceship.x += 15;
				}
				spaceship.y -= 5;
				spaceship.scaleX = parseInt(spaceship.y) / 200 * 0.2;
				spaceship.scaleY = parseInt(spaceship.y) / 200 * 0.2;
				home = stage.getChildByName("home" + player);
				if (intersect(home, spaceship)) {
					home.gotoAndPlay(3);
					spaceship.x = stageW / 2;
					spaceship.y = stageH + 200;
					checkbtn.visible = false;
					currentAns.removeChild(feedback_sign);
					spaceship.scaleX = 1;
					spaceship.scaleY = 1;
					score++;
					sound_func("spaceInStar");
					home.txt.text = "במסיבה של";
					home.name_txt.text = playerName;
					home.txt2.text = "יש" + " " + score + " " + "חייזרים";
					currentAns.gotoAndStop(0);
					option = 2;
					spaceship.removeAllChildren();
					if (myGame.length >= 1) {
						stage.addChild(nextbtn);
						nextbtn.addChild(txt);
						nextbtn.gotoAndStop(player);
						nextbtn.txt.text = "התור של" + " " + otherplayerName;
					} else {
						changePlayer();
					}
				}
			} else {
				createjs.Ticker.paused = true;
			}
		}
		
		//פונקציה שפועלת במעבר עכבר על תשובה
		function answer_mouseover(evt) {
			if (ansewr_posible == 1) {
				evt.currentTarget.addEventListener("mouseover", sound_func("mouseOver_sound"));
				evt.currentTarget.scaleX = 1.04;
				evt.currentTarget.scaleY = 1.04;
				evt.currentTarget.removeEventListener("mouseover", sound_func("mouseOver_sound"));
			}
		}
		
		//פונקציה שפועלת ביציאה ממעבר עכבר
		function answer_mouseout(evt) {
			if (ansewr_posible == 1) {
				if (evt.currentTarget != currentAns) {
					evt.currentTarget.scaleX = 1;
					evt.currentTarget.scaleY = 1;
				}
			}
		}
		
		//פונקציה שפועלת בלחיצה על תשובה
		function answer_click(evt) {
			//רק אם החללית הגיעה למעלה
			if (ansewr_posible == 1) {
				evt.currentTarget.addEventListener("click", sound_func("answerClick_sound"));
				if (check == 0) {
					stage.removeChild(nextbtn);
					check = evt.currentTarget.name;
					checkbtn.visible = true;
					checkbtn.addEventListener('click', check_answer);
					checkbtn.txt.text = "בדוק";
					evt.currentTarget.style = "red";
				} else {
					currentAns.scaleX = 1;
					currentAns.scaleY = 1;
					currentAns.gotoAndStop(0);
				}
				check = evt.currentTarget.name;
				currentAns = evt.currentTarget;
				currentAns.gotoAndStop(1);
				currentAns.scaleX = 1.03;
				currentAns.scaleY = 1.03;
			}
			evt.currentTarget.removeEventListener("click", sound_func("answerClick_sound"));
		}
		
		//פונקציה שפועלת בלחיצה על כפתור בדוק
		function check_answer() {
			if (timeIsUp == false) {
				stage.removeChild(timeArrow);
				arrowOn = false;
			}
			stop_play_status = false;
			stop_play.alpha = 0.3;
			stop_play.cursor = "auto";
			checkbtn.addEventListener("click", sound_func(check));
			//שומר את זמן המענה על השאלה
			if (timePerQ != "no") {
				playerTime = playerTime + timePerQ - 1 - s;
			} else {
				playerTime = playerTime + s;
			}
			clearInterval(clockInt);
			if (timePerQ == 30) {
				m = "00";
				s = 30;
			}
		
			if (timePerQ == 60) {
				m = "01";
				s = 00;
			}
		
			if (timePerQ == 90) {
				m = "01";
				s = 30;
			}
			if (timePerQ == "no") {
				m = "";
				s = 0;
			}
			if (check == "yes") {
				myGame.splice(rnd, 1);
				alienArray.splice(rnd, 1);
				feedback_sign = new feedobject[0];
				//מה קורה לחייזר בתשובה נכונה
				for (i = 0; i < myGame.length; i++) {
					otherAlien = stage.getChildByName(alienArray[i]);
					otherAlien.gotoAndPlay(2 + i);
				}
				checkbtn.alpha = 0;
				currentAns.gotoAndPlay(3);
				option = 3;
			}
			if (check == "no") {
				feedback_sign = new feedobject[1];
				//מה קורה לחייזר בתשובה שגויה
				alien.x = org_alien_positionX;
				alien.y = org_alien_positionY;
				alien.gotoAndStop(24);
				for (i = 0; i < myGame.length; i++) {
					if (alienArray[i] != alien.name) {
						otherAlien = stage.getChildByName(alienArray[i]);
						otherAlien.gotoAndStop(25);
					}
				}
			}
		
			if (check != 0) {
				currentAns.feedbox.addChild(feedback_sign);
			}
			checkbtn.txt.text = "המשך";
			checkbtn.removeEventListener('click', check_answer);
			checkbtn.removeEventListener("click", sound_func(check));
			checkbtn.addEventListener('click', feedback);
			clearInterval(clockInt);
			ansewr_posible = 0;
		}
		
		//פונקציה שקובעת את הפידבק המתאים בהתאם למענה
		function feedback() {
			if (timeIsUp == true) {
				stage.removeChild(timeArrow);
				arrowOn = false;
			}
			checkbtn.removeEventListener('click', feedback);
			checkbtn.addEventListener('click', check_answer);
			checkbtn.visible = false;
			if (timeIsUp == false) {
				currentAns.feedbox.removeChild(feedback_sign);
			}
			if (check == "no") {
				option = 2;
				stage.addChild(nextbtn);
				nextbtn.alpha = 0;
				nextbtn.gotoAndStop(player);
				nextbtn.txt.text = "התור של" + " " + otherplayerName;
				//מאפס את מסיחי השאלה לטובת מיקום רנדומלי 
				for (i = 0; i < myGame[rnd][myGame[rnd].length - 1].length; i++) {
					myGame[rnd][myGame[rnd].length - 1][i][3] = true;
				}
			} else {
				option = 4;
			}
		}
		
		//--- בדיקת חפיפה בין שני אובייקטים
		function intersect(obj1, obj2) {
		
			var obj1W = obj1.nominalBounds;
			var obj2W = obj2.spacePose.nominalBounds;
		
			if (obj1.x + (obj1W.width / 2) <= obj2.x - (obj2W.width / 2)) {
				return false;
			} else if (obj1.y + (obj1W.height / 2) <= obj2.y - (obj2W.height / 2)) {
				return false;
			} else if (obj1.x - (obj1W.width / 2) > obj2.x + (obj2W.width / 2)) {
				return false;
			} else if (obj1.y - (obj1W.height / 2) > obj2.y + (obj2W.height / 2)) {
				return false;
			}
			return true;
		}
		
		function countclock() {
			if (timePerQ != "no") {
				if (s < 10) {
					clock.text = m + ":" + "0" + s;
					if (arrowOn == false && m == "00") {
						timeArrow = new arrow[player][0]();
						timeArrow.x = arrow[player][1];
						timeArrow.y = arrow[player][2];
						stage.addChild(timeArrow);
						arrowOn = true;
					}
				} else {
					clock.text = m + ":" + s;
				}
				if (s <= 0) {
					if (m == "01") {
						m = "00";
						s = 59;
					} else {
						ansewr_posible = 0;
						stage.removeChild(timeArrow);
						timeArrow = new static_arrow[player][0]();
						timeArrow.x = static_arrow[player][1];
						timeArrow.y = static_arrow[player][2];
						stage.addChild(timeArrow);
						timeIsUp = true;
						if (check == 0) {
							check = "no";
							currentAns = stage.getChildByName("sign_" + player);
							checkbtn.visible = true;
							checkbtn.addEventListener('click', feedback);
							stage.addChild(txt);
							checkbtn.txt.text = "המשך";
							sign.txt.text = "נגמר הזמן, החללית של";
							sign.name_txt.text = playerName;
							sign.txt2.text = "צריכה לצאת";
							check_answer();
						} else {
							check_answer();
						}
					}
				} else {
					s--;
				}
			} else {
				s++;
			}
		}
